/**
 * Font attributes of a UIButton, a UIEntry, or a UILabel
 * Reference: https://docs.microsoft.com/en-us/dotnet/api/xamarin.forms.fontattributes
 */
export class FontAttributes {
    /** @returns {FontAttributes} */ static get NONE(): FontAttributes;
    /** @returns {FontAttributes} */ static get ITALIC(): FontAttributes;
    /** @returns {FontAttributes} */ static get BOLD(): FontAttributes;
}
